import React from 'react';
import { Link, useLocation } from "react-router-dom";


export default function Page_title(props) {
    const title = props;
    const location = useLocation();
    // const massive = location.split('/');
    // // console.log(massive[0]);

    return (
        <div className="descr-title">
            <Link to={title.prevPath} className="descr-title-container container flex">
                <div className="back-group flex">
                    <span className="back-line"></span>
                    <span className="back">Назад</span>
                </div>
                <h1 className="descr-title-text">{title.getTitle}</h1>
            </Link>
        </div>
    )
}
